import React from 'react';

class RestaurantImage extends React.Component {
  constructor(props) {
    super(props);

  }

  render(){
    return(
      <div class="flex bg-green-400 justify-center items-center">
        <img alt="Restaurant" src="#{this.props.image}"/>
      </div>
    )
  }
}

export default RestaurantImage;
